import React from 'react'
import ReactTimeAgo from 'react-time-ago'

const Posted = (props) => {
  return (
    <div>
      Posted <ReactTimeAgo date={props.created_at} locale="en-US" timeStyle="twitter"/> ago
    </div>
  )
}

export default Posted;
